// Simple debug - just log everything we receive
console.log('=== SIMPLE DEBUG START ===');
console.log('Total items received:', items.length);

for (let i = 0; i < items.length; i++) {
  console.log(`\n--- Item ${i} ---`);
  console.log('Item keys:', Object.keys(items[i]));
  console.log('Item type:', typeof items[i]);

  if (items[i].json) {
    console.log('JSON keys:', Object.keys(items[i].json));
    console.log('JSON content:', JSON.stringify(items[i].json, null, 2));
  }

  if (items[i].binary) {
    console.log('Binary keys:', Object.keys(items[i].binary));
  }

  console.log('Full item:', JSON.stringify(items[i], null, 2));
}

console.log('=== SIMPLE DEBUG END ===');

// Just pass through the first item
return [items[0]];
